import React from 'react';
import styles from '../../styles/layout/NavbarBtn.module.scss';

const DashboardButton = (props) => {
	// const style = () => {
	// 	if (props.style === 'large') {
	// 		return styles.large;
	// 	} else if (props.style === 'alternative') {
	// 		return styles.alternative;
	// 	} else if (!props.style) {
	// 		return styles.small;
	// 	}
    // };
    
    const style = () => {
        const classStyle = props.style;
        switch (classStyle) {
            case 'large':
                return styles.large
                break;
            case 'alternative':
                return styles.alternative
                break;
            default:
                return styles.small
        }
    }

	return (
		<button onClick={props.onClick} className={style()}>
			{props.children}
		</button>
	);
};

export default DashboardButton;
